import React from 'react'

const homeheader = () => {
  return (
    <div className="home-header-page">
      <div className="header-content">
      <h1>Realizing a more sustainable future.</h1>
      <h3>Haarmk is helping companies monitor, track and take action on their environmental impact.</h3>
      <button>Learn More</button>
      </div>
    </div>
  )
}

export default homeheader
